import Logo from '../../assets/logo.png';
import SearchIcon from '../../assets/search-icon.svg';
import './navigation.styles.scss';
import ShopOurProducts from '../shop-our-products/shop-our-products.component'
const Navigation  =() =>{
  return(
    <div>

      <img src={Logo} width={120} height={90.24}/>
    <div>
      <ul id='navbar'>
      <li><a href='get-started.jsx'>Get Started</a></li>
      <li><a href='shop.jsx'>Shop </a></li>
      <li><a href='useful-information'>Useful Information</a></li>
      <li><a href='about.jsx'>About</a></li>
      <img src={SearchIcon} width={22.4} height={22.4}/>
    </ul>
    </div>

    </div>


  )
}

export default Navigation;
